                                                                                                                                            <span class="d2edcug0 hpfvmrgz qv66sw1b c1et5uql rrkovp55 a8c37x1j keod5gw0 nxhoafnm aigsh9s9 d3f4x2em fe6kdd0r mau55g9w c8b282yb iv3no6db gfeo3gy3 a3bd9o3v knj5qynh oo9gr5id hzawbc8m" dir="auto"><div class="kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q"><div dir="auto" style="text-align: start;">SCB Protect แผนคุ้มรักษาเหมาจ่าย จ่ายทุกค่ารักษาพยาบาล หากคุณต้องนอนโรงพยาบาล ค่ารักษาเท่าไหร่ ก็จ่ายตามนั้น ให้คุณสบายใจได้ว่า เดินออกจากโรงพยาบาลโดยไม่เสียส่วนต่างค่ารักษาอีกต่อไป </div><br><div dir="auto" style="text-align: start;"><span class="pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu"><img height="16" width="16" alt="🟣" src="https://static.xx.fbcdn.net/images/emoji.php/v9/t7d/1/16/1f7e3.png"></span> จ่ายค่ารักษาพยาบาลตามจริง</div><div dir="auto" style="text-align: start;"><span class="pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu"><img height="16" width="16" alt="🟣" src="https://static.xx.fbcdn.net/images/emoji.php/v9/t7d/1/16/1f7e3.png"></span> แผนสุขภาพเหมาจ่าย สูงสุดถึง 3,300,000 บาท</div><div dir="auto" style="text-align: start;"><span class="pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu"><img height="16" width="16" alt="🟣" src="https://static.xx.fbcdn.net/images/emoji.php/v9/t7d/1/16/1f7e3.png"></span> ครอบคลุมทุกค่ารักษา ด้วยเบี้ยประกันภัย</div><div dir="auto" style="text-align: start;"><span class="pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu"><img height="16" width="16" alt="🟣" src="https://static.xx.fbcdn.net/images/emoji.php/v9/t7d/1/16/1f7e3.png"></span> ค่าชดเชยรายวันเมื่อเข้ารักษาตัวในโรงพยาบาล</div></div><div class="o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q">ผู้ซื้อควรทำความเข้าใจรายละเอียดและเงื่อนไขก่อนตัดสินใจทำประกันภัยทุกครั้ง</div><div dir="auto" style="text-align: start;">รับประกันโดยบริษัท เอฟดับบลิวดี ประกันชีวิต จำกัด (มหาชน) โทร.1351</div><div dir="auto" style="text-align: start;">บริษัท ไทยพาณิชย์ โพรเทค จำกัด เป็นเพียงนายหน้าประกันภัย</div><div dir="auto" style="text-align: start;"><span><a class="oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl q66pz984 gpro0wi8 b1v8xokw" href="https://www.facebook.com/hashtag/scbprotect?__eep__=6&amp;__cft__[0]=AZWIM9Rn40ram_0H7SQYj9gFAb771w0c8unu3K5A7tw-QnyQX1My-iOA5zoEyg2iMHHEfcMLPqiM2UrLnEL3fw4Ic8stOGb5kMIH-3BrcFYOjBEWFSg5w9DjnQ4e3xZcPsd9r322D9lZCGmGdLbnPCHO&amp;__tn__=*NK-R" role="link" tabindex="0">#SCBProtect</a></span> <span><a class="oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl q66pz984 gpro0wi8 b1v8xokw" href="https://www.facebook.com/hashtag/%E0%B9%84%E0%B8%97%E0%B8%A2%E0%B8%9E%E0%B8%B2%E0%B8%93%E0%B8%B4%E0%B8%8A%E0%B8%A2%E0%B9%8C%E0%B9%82%E0%B8%9E%E0%B8%A3%E0%B9%80%E0%B8%97%E0%B8%84?__eep__=6&amp;__cft__[0]=AZWIM9Rn40ram_0H7SQYj9gFAb771w0c8unu3K5A7tw-QnyQX1My-iOA5zoEyg2iMHHEfcMLPqiM2UrLnEL3fw4Ic8stOGb5kMIH-3BrcFYOjBEWFSg5w9DjnQ4e3xZcPsd9r322D9lZCGmGdLbnPCHO&amp;__tn__=*NK-R" role="link" tabindex="0">#ไทยพาณิชย์โพรเทค</a></span> <span><a class="oajrlxb2 g5ia77u1 qu0x051f esr5mh6w e9989ue4 r7d6kgcz rq0escxv nhd2j8a9 nc684nl6 p7hjln8o kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x jb3vyjys rz4wbd8a qt6c0cv9 a8nywdso i1ao9s8h esuyzwwr f1sip0of lzcic4wl q66pz984 gpro0wi8 b1v8xokw" href="https://www.facebook.com/hashtag/%E0%B8%84%E0%B8%B8%E0%B9%89%E0%B8%A1%E0%B8%84%E0%B8%A3%E0%B8%AD%E0%B8%87%E0%B8%84%E0%B8%B8%E0%B9%89%E0%B8%A1%E0%B8%84%E0%B9%88%E0%B8%B2%E0%B9%80%E0%B8%84%E0%B8%B5%E0%B8%A2%E0%B8%87%E0%B8%82%E0%B9%89%E0%B8%B2%E0%B8%87%E0%B8%84%E